    data: |
      SELECT ALL col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col2 BETWEEN - col1 AND ( col0 - 71 * + CAST ( ( - ( col2 ) ) AS INTEGER ) );
  - name: tab1

outputs:
  - name: q13196.out
    data: |
